import { useEffect, useState } from "react";

export function Emptable() {
  const [data] = useState("");
  useEffect(() => {
    fetch = " http://localhost:3006/employesdata"
      .then((res) => {
        return res.json();
      })
      .then((resp) => {
        console.log(resp);
      })
      .catch((err) => {
        console.log(err.message);
      });
  });

  return (
    <div>
      <div className="card">
        <div className="card-title">
          j <h2>Employee Manegement System</h2>
        </div>
        <div className="card-body">
          <table className="table table- bordered">
            <thead className="bg-dark text-light">
              <tr>
                <th>id</th>
                <th>name</th>
                <th>email</th>
                <th>mobile</th>
                <th>action</th>
              </tr>
            </thead>
            <tbody>
              {data &&
                data.map((item) => (
                  <tr>
                    <td>{item.id}</td>

                    <td>{item.name}</td>

                    <td>{item.email}</td>

                    <td>{item.mobile}</td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
export default Emptable;
